import React from "react";

function ExamResult({ questions }) {
  return (
    <div>
      <h1>Exam Result</h1>
      <table className="table">
        <thead>
          <tr>
            <th>Question</th>
            <th>Mark</th>
          </tr>
        </thead>
        <tbody>
          {questions.map((question, index) => (
            <tr key={index}>
              <td>{`Question ${index + 1}`}</td>
              <td>{question.marks}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default ExamResult;
